    render() {
        return (
            <div className="card">
            <a href="/details"><img className="card-img-top" src={this.props.pic} alt="" /></a>
            <div className="card-body">
              <h4 className="card-title">{this.props.title}</h4>
              <p className="card-text">Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget,...</p>
            </div>
          </div>
        );
    }
}

export default NewsOthers;
